window.bookSummaryJSON = "<p><b><i>Welcome to Latibulum Noctis…</i></b></p> <p>At the Whitmore estate, the infamous party is more than just an invitation—it’s a test of fate.</p> <p>The guests gather to play a game of hide and seek, where luck and misfortune intertwine in every shadow. When the clock strikes midnight, the true nature of <i>Latibulum Noctis</i> reveals itself.</p> <p>Consumed with a need for answers, Valeria’s mission is clear: uncover the truth behind the mysterious disappearance of her beloved, who vanished many years ago, leaving behind nothing but haunting memories of their past.</p> <p>As the night deepens, an enigmatic stranger that Valeria had once met on Halloween, emerges from the shadows, ensnaring her in a web of deceit and desire.</p> <p>Valeria steps into the unknown, where the boundary between love and madness blurs, and she realizes that every heartbeat could be her last.</p>"; 
